            body: JSON.stringify({
                userPatch: "patch",
            })
        };

        fetch("/api/savePatch", savePatchRequestOptions).then((res) => {
            return res.json()
        }).then(data => {
            console.log(data)
        });

    }

    return (

        <Save
            onClick={handleClick}
        >
            SAVE
        </Save>

    )
}

